import React, { useState } from 'react'
import './TicTacToe.css'
import dog_icon from '../Assets/dog.png'
import cat_icon from '../Assets/cat.jpg'

let data = ["","","",
            "","","",
            "","",""]

            const TicTacToe = () => {
                const [selectedSize, setSelectedSize] = useState('S');
                const [count, setCount] = useState(0);
                const [lock, setLock] = useState(false);

                const toggle = (e, num) => {
                    if (lock || data[num] !== "") {
                        return;
                    }

                    const pieceSize = selectedSize;
                    const currentPlayer = count % 2 === 0 ? 'Dog' : 'Cat';

                    e.target.innerHTML = `<img src='${currentPlayer === 'Dog' ? dog_icon : cat_icon}' style="width: ${pieceSize}">`;
                    data[num] = currentPlayer;
                    setCount(count + 1);

                    // Check for a winner
                    const winner = calculateWinner();
                    if (winner) {
                        alert(`Player ${winner} wins!`);
                        setLock(true);
                    }
                };

                const calculateWinner = () => {
                    // Logic to check for a winner
                    const lines = [
                        [0, 1, 2],
                        [3, 4, 5],
                        [6, 7, 8],
                        [0, 3, 6],
                        [1, 4, 7],
                        [2, 5, 8],
                        [0, 4, 8],
                        [2, 4, 6],
                    ];

                    for (let i = 0; i < lines.length; i++) {
                        const [a, b, c] = lines[i];
                        if (data[a] && data[a] === data[b] && data[a] === data[c]) {
                            return data[a];
                        }
                    }

                    return null;
                };

                const resetGame = () => {
                    data = ["", "", "", "", "", "", "", "", ""];
                    setCount(0);
                    setLock(false);

                    // Clear the innerHTML of all boxes
                    const boxes = document.querySelectorAll('.boxes');
                    boxes.forEach((box) => (box.innerHTML = ''));
                };
    return (
        <div className='container'>
        <h1 className="title">PawClaw <span>XO</span></h1>
        <div className='board'>
            <div className="row1">
                <div className="boxes" onClick={(e) => {toggle(e,0)}}></div>
                <div className="boxes" onClick={(e) => {toggle(e,1)}}></div>
                <div className="boxes" onClick={(e) => {toggle(e,2)}}></div>
            </div>
            <div className="row2">
                <div className="boxes" onClick={(e) => {toggle(e,3)}}></div>
                <div className="boxes" onClick={(e) => {toggle(e,4)}}></div>
                <div className="boxes" onClick={(e) => {toggle(e,5)}}></div>
            </div>
            <div className="row3">
                <div className="boxes" onClick={(e) => {toggle(e,6)}}></div>
                <div className="boxes" onClick={(e) => {toggle(e,7)}}></div>
                <div className="boxes" onClick={(e) => {toggle(e,8)}}></div>
            </div>

        </div>
        <div className="Size">
            <button className="PieceSizeS" onClick={() => setSelectedSize('S')}>S</button>
            <button className="PieceSizeM" onClick={() => setSelectedSize('M')}>M</button>
            <button className="PieceSizeL" onClick={() => setSelectedSize('L')}>L</button>
        </div>


        <button className='reset'>Reset</button>
        </div>
    );
}
export default TicTacToe
